(14751, 'ruRU', 'Соберите перечисленных ниже кадавров с помощью сшивания поганищ.', 'Как здорово, что все мы здесь', 'Награда: таурал дома Избранных', 38134),
(14752, 'ruRU', 'Заработайте перечисленные ниже достижения, связанные со сшиванием поганищ.', 'Чем заняться после смерти', 'Наградное звание \"Мастер поганищ\" и награда – бронированный таурал дома Избранных', 38134),
(14753, 'ruRU', 'Сдайте 100 усиленных анимой обмоток призывателю Жерару, чтобы помочь призвать Визектуса, призрака войны.', 'Обмотки войны', '', 38134),
(14764, 'ruRU', 'Найдите большую удачку с помощью Корди.', 'Большая удачка!', '', 38134),
(14775, 'ruRU', 'Добейтесь превознесения Чесночника.', 'Дружба с грибами', 'Наградное звание: смешной парень / смешная девчонка', 38134),
(14777, 'ruRU', 'Улучшите все функции обители ковенанта.', 'Эксперт по восстановлению', '', 38134),
(14780, 'ruRU', 'Выполните все задания Ом по медитации в королевском зимнем саду и достигните внутренней гармонии.', 'Мастер медитации', '', 38134),
(14789, 'ruRU', 'Выполните все задания Лии и восстановите всех духов животных в королевском зимнем саду.', 'Духи большие и маленькие', '', 38134),
(14833, 'ruRU', 'Создайте перечисленные ниже модные аксессуары с помощью сшивания поганищ.', 'Модное поганище', '', 38134),
(14839, 'ruRU', 'Повысьте уровень трех медиумов до 60-го в приключениях.', 'Тяга к приключениям', '', 38134),
(14840, 'ruRU', 'Повысьте уровень искателя приключений до 20-го.', 'Приключения: азы профессии', '', 38134),
(14841, 'ruRU', 'Повысьте уровень искателя приключений до 40-го.', 'Приключения: теперь ты в деле', '', 38134),
(14842, 'ruRU', 'Повысьте уровень искателя приключений до 60-го.', 'Приключения: сила и упорство', '', 38134),
(14843, 'ruRU', 'Соберите всех 12 искателей приключений ковенанта.', 'Приключения: общее предназначение', '', 38134),
(14844, 'ruRU', 'Завершите перечисленные ниже приключения в Утробе.', 'Приключения: все в атаку!', '', 38134),
(14845, 'ruRU', 'Завершите приключение.', 'Приключения: шаг в нужном направлении', '', 38134),
(14846, 'ruRU', 'Завершите 10 приключений.', 'Приключения: листья в лесу', '', 38134),
(14847, 'ruRU', 'Завершите 100 приключений.', 'Приключения: защитник Темных Земель', '', 38134),
(14851, 'ruRU', 'Победите Калисфену и Малодушного Коринфа, использовав выкованную духами эгиду.', 'Бастион защиты', '', 38134),
(14852, 'ruRU', 'Победите Альдерина и Мин\'ир и изломанный кошмар Миканикосом в испытании Верности.', 'Эй, ухнем', '', 38134),
(14853, 'ruRU', 'Победите Безумного Мортимера, подвергнувшись воздействию огненной крови, заморозки и неудержимой рвоты.', 'Все оттенки боли', '', 38134),
(14854, 'ruRU', 'Победите в испытании Верности, использовав все предметы снаряжения для медиумов.', 'Дело не в том, что ты носишь', '', 38134),
(14856, 'ruRU', 'Победите в испытании Мудрости, надев пять подвесок.', 'В подвешенном состоянии', '', 38134),
(14857, 'ruRU', 'Победите Эктру в испытании Мудрости, убив 20 ползунов.', 'Восьминогое воинство', '', 38134),
(14858, 'ruRU', 'Победите Малодушного Коринфа в испытании Мудрости после того, как он поглотит две сферы анимы.', 'Проклятие жажды', '', 38134),
(14859, 'ruRU', 'Победите \"Атаноса\" в испытании Мудрости, пережив пять \"Мощных замахов\".', 'Внутренний хоум-ран', '', 38134),
(14860, 'ruRU', 'Победите в испытании Мудрости, не используя снаряжение для медиумов.', 'Ничего лишнего', '', 38134),
(14861, 'ruRU', 'Победите Калисфену и \"Атаноса\" в испытании Мудрости Пелагием, Клейей и Миканикосом.', 'Учиться у мастеров', '', 38134),
(14862, 'ruRU', 'Победите в испытании Смирения, использовав все предметы снаряжения для медиумов.', 'Дело в том, как ты это носишь', '', 38134),
(14863, 'ruRU', 'Победите Тран\'тиок в испытании Мудрости, не нанося ей урон до того, как вы разрушите все филактерии.', 'Четыре лика одной личины', '', 38134),
(14864, 'ruRU', 'Победите Азаруукса в испытании Мудрости Пелагием, не трогая воспоминания.', 'Личный кошмар', '', 38134),
(14865, 'ruRU', 'Пройдите все десять испытаний Смирения Пелагием, Клейей и Миканикосом.', 'Послушник храма Смирения', '', 38134),
(14866, 'ruRU', 'Пройдите все десять испытаний Смирения, не используя подвески и не активируя жаровни.', 'Мастер Пути', '', 38134),
(14887, 'ruRU', 'Помашите \"Атаносу\" на прощание после того, как он помашет вам.', 'На Луну!', '', 38134),
(15023, 'ruRU', 'Откройте первый уровень улучшений для всех четырех ковенантов.', 'Еще не все потеряно', 'Награда: больше анимы за выполнение задач', 38134),
(15024, 'ruRU', 'Откройте второй уровень улучшений для всех четырех ковенантов.', 'Засуха – это временно', 'Награда: больше анимы за выполнение задач', 38134),
(15025, 'ruRU', 'Откройте третий уровень улучшений для всех четырех ковенантов.', 'Любитель обителей', 'Награда: больше анимы за выполнение задач', 38134);
